  false,\n\t\"url\": null,\n\t\"notes\": \"This report represents an initial biological
  assessment of wetland conditions on Long Lake National Wildlife Refuge (NWR), Slade
  NWR, and Florence Lake NWR that was conducted as part of the pre-planning phase
  for development of a Comprehensive Conservation Plan (CCP). According to the 1997
  National Wildlife Refuge System Improvement Act (NWRSIA), decisions guiding NWR
  management should be based on the best available scientific information. Therefore,
  this report attempts to integrate relevant information from many different scientific
  disciplines (e.g., geology, hydrology, biology) to assist the U.S. Fish and Wildlife
  Service (USFWS) in identifying ecological constraints and opportunities imposed
  by the land base being considered. The intent is to provide information and ideas
  necessary for evaluating the potential benefits and detriments of management actions
  during the decision making process that accompanies development of biological goals
  and objectives.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
